import 'animate.css'

import React from "react";
import loadingPic from './bg.png'
const LandingPage = () => {
  return (
  <main className='flex items-center'>
    <div clas>
    <img src={loadingPic} height={100} width={100} />
    </div>
  </main>
  );
};



export default LandingPage;
